var dymo_framework_check, dymo_printer_check, find_github_user, hestia_start;

window.hestia = {
  debug: false,
  css_transition_duration: 100
};

$(function() {
  var done_typing_interval;
  if ((typeof dymo === "undefined" || dymo === null) || (dymo.label == null) || (dymo.label.framework == null)) {
    console.log("DYMO JS framework not loaded, make sure the DYMO JS library is available.");
  } else {
    hestia.d = dymo.label.framework;
  }
  dymo_framework_check();
  $('#submit').on('click', function(event) {
    return event.preventDefault();
  });
  $('.reload-page').on('click', function(event) {
    event.preventDefault();
    return location.reload();
  });
  done_typing_interval = 1000;
  hestia.typing_timer = void 0;
  $('input#github-username').on('blur', function(event) {
    var github;
    clearTimeout(hestia.typing_timer);
    github = $('input#github-username').val();
    if (github.length > 0) {
      return find_github_user(github);
    }
  });
  return $('input#github-username').on('keyup', function() {
    var github;
    clearTimeout(hestia.typing_timer);
    github = $('input#github-username').val();
    if (github.length > 0) {
      return hestia.typing_timer = setTimeout(function() {
        return find_github_user(github);
      }, done_typing_interval);
    }
  });
});


/*
 * -------------------
 * DYMO labeling magic
 * -------------------
 */

dymo_framework_check = function() {
  var $el, env, recheck_dymo;
  env = hestia.d.checkEnvironment();
  if (hestia.debug) {
    console.log('DYMO environment: ', env);
  }
  if (!env.isBrowserSupported) {
    return console.log("The DYMO JS framework doesn't support this browser.");
  } else if (!env.isFrameworkInstalled) {
    $el = $('#dymo-not-loaded');
    $el.html($el.data('error')).slideDown();
    console.log("Make sure you gave permission for the DYMO browser plugin to run on this page. Try reloading the page if this message persists, or check page permissions.");
    console.log("\t --> DYMO reports: " + env.errorDetails);
    recheck_dymo = function() {
      if (hestia.d.checkEnvironment().isFrameworkInstalled) {
        $el.addClass('success');
        $el.html($el.data('success'));
        return setTimeout(function() {
          return $el.slideUp('slow', function() {
            $el.removeClass('success');
            return dymo_printer_check();
          });
        }, 2500);
      } else {
        return setTimeout(recheck_dymo, 500);
      }
    };
    return recheck_dymo();
  } else {
    return dymo_printer_check();
  }
};

dymo_printer_check = function() {
  var $el;
  if (!hestia.d.getPrinters().length > 0) {
    $el = $('#no-dymo-printer:hidden');
    return $el.html($el.data('error')).slideDown();
  } else {
    return $.get('/dymo-template', function(data) {
      return hestia_start(data);
    });
  }
};

